import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './style.css';

export const TipusCreate = () => {
    const navigate = useNavigate();
    
    return (
        <div className="create-container">
            <h2 className="create-title">Új hal felvétele</h2>
            <form
                className="create-form"
                onSubmit={(event) => {
                    event.preventDefault();
                    const formData = {
                        nev: event.target.nev.value,
                        faj: event.target.faj.value,
                        meret_cm: event.target.meret_cm.value,
                        to_id: event.target.to_id.value,
                        kep: event.target.kep.value,
                    };
                    axios.post("https://localhost:5001/api/Halak", formData, {
                        headers: { 'Content-Type': 'application/json' },
                    })
                    .then(() => navigate("/"))
                    .catch((error) => console.error("Hiba történt:", error));
                }}
            >
                <div className="form-group">
                    <label>Név:</label>
                    <input type="text" name="nev" className="form-control" />
                </div>
                <div className="form-group">
                    <label>Faj:</label>
                    <input type="text" name="faj" className="form-control" />
                </div>
                <div className="form-group">
                    <label>Méret(cm):</label>
                    <input type="number" name="meret_cm" className="form-control" />
                </div>
                <div className="form-group">
                    <label>Tó id:</label>
                    <input type="number" name="to_id" className="form-control" />
                </div>
                <button type="submit" className="submit-button">Felvitel</button>
            </form>
        </div>
    );
};
